import axios from "axios";

export const getMovieList = () => axios.get('http://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=5622df58bf74fc555a60bcb2baf58da6&targetDt=20210322')
    .then((res) => {
        return res.data
    })

export const getMovieDirector = () => axios.get('http://www.kobis.or.kr/kobisopenapi/webservice/rest/movie/directors.json?key=5622df58bf74fc555a60bcb2baf58da6&movieCd=20216069')
    .then((res) => {
        return res.data
    })
